webpackJsonp([0x7c7b9a9c056f],{1353:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/link-voice-synthesis-in-adobe-air-2-0/index.md absPath of file >>> MarkdownRemark",html:'<img class="alignnone size-full wp-image-1195" title="Voice Synth with AIR 2.0" src="/content/images/2010/04/voice-synth.png" alt="" width="500" height="280" />\n<p>Here\'s another cool library for AIR applications.  It works for both Windows and Mac environments, and uses the NativeProcess access of AIR version 2 to tap into the built-in voice synthesis functionality of the operating system.  It\'s still in development, is more developed for Mac than for Windows (at the moment) but it\'s looking pretty good already.</p>\n<p>Should be a good one to have a play with soon!</p>\n<p>Read the authors\' blog post here: <a href="http://blog.technolog33k.fr/adobe-air/20-12-2009-voice-synthesis-in-adobe-air-with-the-nativeprocess-api/" target="_blank">http://blog.technolog33k.fr/adobe-air/20-12-2009-voice-synthesis-in-adobe-air-with-the-nativeprocess-api/</a></p>\n<p>Access the source code for the library from the Google code repository here: <a href="http://code.google.com/p/nativespeech/" target="_blank">http://code.google.com/p/nativespeech/</a></p>',frontmatter:{title:"Link: Voice synthesis in Adobe AIR 2.0",date:"April 09, 2010",tags:["voice-synthesis"]}}},pathContext:{}}}});
